import React, { Component } from "react";

class ChuckNorris extends Component {
  constructor(props) {
    super(props);
    this.state = {
      brand: "Ford"
    };
  }

  render() {
    return <h3>My Car is a {this.state.brand}</h3>;
  }
}

export default ChuckNorris;
